import logo from './logo.svg';
import './App.css';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css"
import Navbar from './layout/navbar';
import Home from './pages/home';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Importing the Browser 

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar></Navbar>

        <Routes>
          <Route exact path ="/" element></Route>
        </Routes>

        <hr></hr>
        <Home></Home>

      </Router>

    </div>
  );
}

export default App;
